response.about:
«Потеря Тепла» родилась в Москве в мае 2005 года. Её лидеры были основателями групп «Неприкосновенный Запас» и «Осколки». Но в 2005 году, встретив молодых талантливых прогрессивных ребят, решили основать новый коллектив, подарив старое название «Осколки» не вошедшим в свежий состав.

Группа «Потеря Тепла» придерживается стиля «калифорнийский панк» с элементами альтернатива, реггей и ска. В своем творчестве «П.Т.» широко использует современные технологии. В настоящее время состав группы насчитывает 7 человек

На творчество «П.Т.» оказала влияние музыка практически всех исполнителей от Чака Берри до «R.A.T.M.», и большое количество отечественных музыкантов и коллективов, в число которых не входят такие звезды как Алсу, Тату, и прочие.

Запуск человека в космос, изобретение 1го персонального компьютера, вакцин от туберкулеза и столбняка и финансовый кризис 98 года тоже оказали на музыку группы огромное влияние. Музыканты выражают огромную благодарность тем, кто смог, и, в особенности, тем, кто не смог повлиять на их творчество, поэтому стоит послушать их музыку хотя бы один раз, чтобы зарядиться позитивом

В данное время коллектив состоит из 8 человек:

    * Григорьев Вячеслав (вокал);
    * Афанасьев Евгений (клавиши, бэк-вокал);
    * Афанасьев Антон (бас-гитара);
    * Долгов Павел (ударные);
    * Гацкая Надежда (бэк-вокал);
    * Дубравина Антонина (бэк-вокал);
    * Зиновьев Никита (гитара) - трагически ушел из жизни 15 февраля 2007 года;
    * Никитин Вадим (гитара).
    * по семейным обстоятельствам группу покинул Максимов Гена
